<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>WowCosplay</title>
    <style>
        body {
            background-color: black;
            z-index: 1
        }

        #myd {
            position: absolute;
            z-index: 2;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
        }

        #myd2 {
            position: relative;
        }

        .img {
            position: absolute;
            bottom: -220px;
            left: -30px;
        }

        input[type="text"] {
            width: 300px;
            padding: 10px;
            border: 2px solid #4CAF50;
            border-radius: 5px;
            font-size: 16px;
            transition: border-color 0.3s;
        }

        input[type="text"]:focus {
            border-color: #f44336;
        }

        .btn-gradient {
            display: inline-block;
            padding: 12px 24px;
            font-size: 16px;
            color: #fff;
            background: linear-gradient(45deg, #6a11cb 0%, #2575fc 100%);
            border: none;
            border-radius: 25px;
            cursor: pointer;
            transition: background 0.3s ease;
        }

        .btn-gradient:hover {
            background: linear-gradient(45deg, #2575fc 0%, #6a11cb 100%);
        }

    </style>
    <embed id="music" src="music.mp3" width=0 height=0 loop="true" autostart="true"></embed>
</head>
<body>
<div id="myd">
    <div id="myd2">
        <form name="input" method="get">
            <input type="text" id="password" name="name" placeholder="数学造宇宙，星系似钥匙">
            <button class="btn-gradient" type="button" onclick="go()">我想打开</button>
        </form>
        <div class="img">
            <img src="mathpicture.png">

            <p style="color:gray;font-size:12px">保留4位小数</p>
        </div>
    </div>
</div>
<div id="canvadiv">
    <canvas id="myCanvas" width="850" height="500"></canvas>
</div>
